import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Card from './components/Card';

export default function Priority1() {
  const [users_data, setusers_data] = useState(null);
  const [ticket_data, setticket_data] = useState(null)

  const [user_name, setuser_name] = useState([])


const [name_array, setname_array] = useState([])


  const fetchData = async () => {
    try {
      const user_response = await axios.get('https://api.quicksell.co/v1/internal/frontend-assignment');
      setusers_data(response.data.users);
      setticket_data(response.data.tickets);
      
       
    
    } catch (error) {
      console.error('Axios error:', error);
    }
  
    


};

  const add_card = () => {
    const newcardlist_Urgent = [];
    const newcardlist_High = [];
    const newcardlist_Medium = [];
    const newcardlist_Low = [];
    const newcardlist_Nopriority = [];

    for (const item of data) {
      const card = <Card key={item.id} name={item.id} desc={item.title} tag={item.tag[0]} />;

      if (item.priority === 0) {
        newcardlist_Nopriority.push(card);
      } else if (item.priority === 1) {
        newcardlist_Low.push(card);
      } else if (item.priority === 2) {
        newcardlist_Medium.push(card);
      } else if (item.priority === 3) {
        newcardlist_High.push(card);
      } else if (item.priority === 4) {
        newcardlist_Urgent.push(card);
      }
    }

    setcard_list_Nopriority(newcardlist_Nopriority);
    setcard_list_Low(newcardlist_Low);
    setcard_list_Medium(newcardlist_Medium);
    setcard_list_High(newcardlist_High);
    setcard_list_Urgent(newcardlist_Urgent);
    setAddCardExecuted(true); 
  };

  useEffect(() => {
    fetchData();
  }, []);

  useEffect(() => {
    if (data && !addCardExecuted) { 
      add_card();
    }
  }, [data, addCardExecuted]);


 //console.log(card_list_Nopriority.length)

  return (
    <div style={{ display: 'flex', backgroundColor: 'rgb(211, 225, 230)', height: '100%' }}>
      <div style={{ width: '20%' }}><div style={{display:"flex"}}>No priority<div style={{position:"relative",marginLeft:"15px"}}>{card_list_Nopriority.length}</div></div>{card_list_Nopriority}</div>
      <div style={{ width: '20%' }}><div style={{display:"flex"}}>Urgent<div style={{position:"relative",marginLeft:"15px"}}>{card_list_Urgent.length}</div></div>{card_list_Urgent}</div>
      <div style={{ width: '20%' }}><div style={{display:"flex"}}>High<div style={{position:"relative",marginLeft:"15px"}}>{card_list_High.length}</div></div>{card_list_High}</div>
      <div style={{ width: '20%' }}><div style={{display:"flex"}}>Medium<div style={{position:"relative",marginLeft:"15px"}}>{card_list_Medium.length}</div></div>{card_list_Medium}</div>
      <div style={{ width: '20%' }}><div style={{display:"flex"}}>Low<div style={{position:"relative",marginLeft:"15px"}}>{card_list_Low.length}</div></div>{card_list_Low}</div>
    </div>
  );
}
